import React from 'react'
import {Row,Col} from 'react-bootstrap'
import Products from '../products'
import Product from '../Component/Product'
const Home = () => {
     return (
          <div>
          <Row>
          <Col sm={12} lg={4} xl={3} >
          {
         Products.map((x)=> <Product key={x._id} product={x}/>)
          }
          </Col>
          </Row>
          </div>
     )
}

export default Home
